import './index.css'

function Card() {
    return (
        <div className="cardContainer">
            <div className="profName">
                Professor Name:
                Danny Heap
            </div>
            <div className="score">
                Score:<br></br>
                4.5/5
            </div>
            <div className="comment">
                Comment:<br></br>
                this is very nice.
            </div>
        </div>
    );
  }

  export default Card;
